(7, 'Tầng 2 Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108', 'Số 1B Trần Hưng Đạo, Quận Hai Bà Trưng, Hà Nội', 'Từ nay, người bệnh có thể đặt lịch tại Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108 thông qua hệ thống đặt khám BookingCare:\n\nHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)\nLựa chọn gói khám từ cơ bản đến chuyên sâu theo nhu cầu\nĐược lựa chọn khám với Bác sĩ Chuyên khoa\nGiảm thời gian chờ đợi: Không phải xếp hàng làm thủ tục khám và ưu tiên khám trước', '<p>Từ nay, người bệnh có thể đặt lịch tại Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108 thông qua hệ thống đặt khám BookingCare:</p>\n<p>Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)\nLựa chọn gói khám từ cơ bản đến chuyên sâu theo nhu cầu\nĐược lựa chọn khám với Bác sĩ Chuyên khoa\nGiảm thời gian chờ đợi: Không phải xếp hàng làm thủ tục khám và ưu tiên khám trước</p>\n', , '2024-03-05 17:41:13', '2024-03-05 17:41:13');
