(8, 'Bệnh viện Ung bướu Hưng Việt', '34 Đại Cồ Việt, Hai Bà Trưng, Hà Nội', 'Từ nay, người bệnh có thể đặt khám Bệnh viện Ung bướu Hưng Việt thông qua hệ thống đặt khám BookingCare:\n\nĐược lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệm\nHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch) \nĐặt lịch khám theo giờ hẹn, giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khám\nNhận hướng dẫn chi tiết sau khi đặt lịch', '<p>Từ nay, người bệnh có thể đặt khám Bệnh viện Ung bướu Hưng Việt thông qua hệ thống đặt khám BookingCare:</p>\n<p>Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệm\nHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)\nĐặt lịch khám theo giờ hẹn, giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khám\nNhận hướng dẫn chi tiết sau khi đặt lịch</p>\n', , '2024-03-05 17:41:46', '2024-03-05 17:41:46');
